function bus = newBus(signals)
% Return a SignalBus that contains the signals, passed as cell array of strings.
  bus = Simulink.Bus;
  for i = length(signals):-1:1
    e = Simulink.BusElement;
    e.Name = char(signals(i));
    elements(i) = e;
  end
  bus.Elements = elements;
end
